import CountUI from "../../components/count"
import { connect } from 'react-redux'
import { countAction } from '../../redux/count_action'

function a(state) {
  return { gg: state }
}
function b(store) {
  return {
    ff: (type, value, delay) => {
      setTimeout(() => store.dispatch(countAction(type, parseInt(value))), delay)
    }
  }
}
export default connect(a, b)(CountUI)
